import React, { Component } from 'react';
import {Link} from 'react-router-dom'

class NewPaletteForm extends Component {
    render(){
        return(
            <div>
                <h1>Crete new palette in here</h1>
                <Link to = "/"> Go Back</Link>
            </div>
         
        )
    }
}

export default NewPaletteForm;
